ype=f;vv.provinceShort=a_;vv.cityName=eC;vv.categoryName=m;vv.level=f;vv.eduLevel=d;vv.rankBcur="265";vv.univEnv={consultPhone:"0575-88345555",email:c,inds:[{children:[{id:ag,name:ah,val:c},{id:aT,name:aU,val:c},{id:aa,name:ad,val:c},{id:_,name:$,val:c},{id:ai,name:aj,val:c},{id:aK,name:aM,val:c},{id:aA,name:aB,val:c},{id:aY,name:aZ,val:c},{id:af,name:ae,val:c},{id:aE,name:aF,val:c},{id:bi,name:bj,val:c},{id:T,name:V,val:c}],id:y,name:A},{children:[{id:z,name:G,val:c},{id:M,name:L,val:c},{id:ab,name:ac,val:c},{id:H,name:I,val:c}],id:B,name:C},{children:[{id:N,name:O,val:c},{id:R,name:P,val:c},{id:U,name:S,val:c},{id:x,name:Q,val:c},{id:q,name:ap,val:c},{id:Y,name:Z,val:c},{id:X,name:W,val:c}],id:r,name:D},{children:[{id:bH,name:bP,val:c},{id:F,name:K,val:c},{id:au,name:av,val:c},{id:an,name:ao,val:c}],id:t,name:E},{children:[{id:aC,name:aD,val:aW},{id:am,name:aO,val:iP},{id:v,name:at,val:"79%"}],id:d,name:J}],pubPicture:[{id:16488,imgUrl:"\u002Funiv_env\u002F2021\u002F05\u002F10\u002Ff9b45dee-39df-49f7-bf68-165e5b8b8d91.jpg"},{id:16489,imgUrl:"\u002Funiv_env\u002F2021\u002F05\u002F10\u002Fa2720fdb-9e1a-4bea-8d19-243aa7f0af29.jpg"},{id:16490,imgUrl:"\u002Funiv_env\u002F2021\u002F05\u002F10\u002F724396ba-ae9b-46e2-bb92-e62de4eb1390.jpg"},{id:16491,imgUrl:"\u002Funiv_env\u002F2021\u002F05\u002F10\u002Ff312f2d2-d7ed-47dd-8e6c-7e6e9a8993c8.jpg"},{id:16492,imgUrl:"\u002Funiv_env\u002F2021\u002F05\u002F10\u002Fa1249515-3d08-4573-a0db-cc021fb9eaee.jpg"}],publishedAt:ci,reason:["理由一：办学历史悠久，文化底蕴深厚。学校的办学历史可追溯到1909年创办的山会初级师范学堂，鲁迅先生曾出任山会初级师范学堂监督（校长）。","理由二：办学实力强。目前拥有13个硕士学位点，覆盖学校80%本科专业。学校还有省一流学科（B类）6个，工程学科进入ESI国际学科排名全球前1%。","理由三：师资力量雄厚。学校积极实施人才强校战略，坚持引进和培养相结合，师资队伍结构优。拥有教职工合计1800余人，其中专任教师1100余人，专任教师中高级职称近500人、博士学位教师近500人。","理由四：专业建设优。拥有国家级特色专业3个、国家级一流专业2个、省级重点（优势、特色）专业23个、省一流专业9个。近两届教学成果奖评选中，获国家级教学成果二等奖1项、省级教学成果一等奖4项。","理由五：修德求真、追求卓越的校园精神。由原全国政协副主席、九三学社中央主席韩启德院士和北京大学燕京学堂院长袁明教授倡设的“卓越奖学金”已经评选17届，鼓励学生张扬个性、追求卓越。","理由六：千年古城里的现代大学。学校坐落于全国首批历史文化名城绍兴的古城区，依托古越文化深厚的历史底蕴，传承办学百年的历史文脉，扎根绍兴经济社会发展的现实优势，建设具有现代品格的“江南学府”。","理由七：考生的选择权得到充分满足。学校给学生提供了多次转专业的机会，满足学生的专业需求。一二年级学生每个学期结束时都可向学校申请转专业，据统计，申请转专业学生的成功率达到70%以上，得到学生普遍认可。","理由八：书院制住宿模式全国知名。学校是国内唯一2次被评为“全国高校学生公寓工作一等奖”的高校。学生公寓管理实现了硬件标准化、德育生活化、环境书香化、服务个性化、管理自主化，寝室卫生优秀率位居全省前列。","理由九：毕业生就业率高、就业质量好。毕业生深受社会好评，近五届毕业生高质量就业率保持在96%以上，用人单位满意度调查位居全省同类院校前列。","理由十：宽领域多渠道的国际化办学模式。先后与美国、加拿大、英国、澳大利亚、俄罗斯、日本等23个国家（地区）的60余所高校建立校际合作与交流关系。"]};vv.isVocational=b;vv.charCode=[d];vv.cateCode=[m];vw.up="yanan-university";vw.univCode="RC00736";vw.nameCn="延安大学";vw.nameEn="Yan'anUniversity";vw.logo="logo\u002F39856591.png";vw.tags=[];vw.inbound=b;vw.liked=b;vw.univLikeCount=e;vw.adminType=f;vw.provinceShort=bf;vw.cityName=vx;vw.categoryName=j;vw.level=f;vw.eduLevel=d;vw.rankBcur="266";vw.univEnv={consultPhone:a,email:a,inds:a,pubPicture:a,publishedAt:a,reason:a};vw.isVocational=b;vw.charCode=[d];vw.cateCode=[j];vy.up="hebei-university-of-chinese-medicine";vy.univCode=vz;vy.nameCn="河北中医药大学";vy.nameEn=vA;vy.logo=vB;vy.tags=[];vy.inbound=b;vy.liked=b;vy.univLikeCount=e;vy.adminType=f;vy.provinceShort=aR;vy.cityName=ce;vy.categoryName=cb;vy.level=f;vy.eduLevel=d;vy.rankBcur=vC;vy.univEnv={consultPhone:a,email:a,inds:a,pubPicture:a,publishedAt:a,reason:a};vy.isVocational=b;vy.charCode=[d];vy.cateCode=[cb];vD.up="inner-mongolia-university-of-technology";vD.univCode="RC00233";vD.nameCn="内蒙古工业大学";vD.nameEn="InnerMongoliaUniversityofTechnology";vD.logo="logo\u002F41582349.png";vD.tags=[];vD.inbound=b;vD.liked=b;vD.univLikeCount=e;vD.adminType=f;vD.provinceShort=bZ;vD.cityName=cP;vD.categoryName=h;vD.level=f;vD.eduLevel=d;vD.rankBcur=vE;vD.univEnv={consultPhone:a,email:a,inds:a,pubPicture:a,publishedAt:a,reason:a};vD.isVocational=b;vD.charCode=[d];vD.cateCode=[h];vF.up="shenyang-university";vF.univCode="RC00273";vF.nameCn="沈阳大学";vF.nameEn="ShenyangUniversity";vF.logo="logo\u002F64518610.png";vF.tags=[];vF.inbound=b;vF.liked=b;vF.univLikeCount=e;vF.adminType=f;vF.provinceShort=bb;vF.cityName=cj;vF.categoryName=j;vF.level=f;vF.eduLevel=d;vF.rankBcu